import AppLayout from '../components/AppLayout';
const Profile = () => {
  const [followingList] = [
    { nickname: '제로초' },
    { nickname: '문승준' },
    { nickname: '하울이' },
  ];
  const [followerList] = [
    { nickname: '제로초' },
    { nickname: '문승준' },
    { nickname: '하울이' },
  ];

  return (
    <AppLayout>
      <NicknameEditForm />
      <FollowList header="팔로잉 목록" data={followingList} />
      <FollowList header="팔로워 목록" data={followerList} />
    </AppLayout>
  );
};

Profile.title = '프로필';

export default Profile;
